private static final JsonObject KNOWN_JSON = JsonObject.newBuilder()
            .set(CommandResponse.JsonFields.TYPE, CleanupPersistenceResponse.TYPE)
            .set(CleanupCommandResponse.JsonFields.ENTITY_ID, ID.toString())
            .set(CommandResponse.JsonFields.STATUS, HttpStatusCode.OK.toInt())
            .build();

test_case.body:
@Test
    public void toJsonReturnsExpected() {
        final JsonObject jsonObject = CleanupPersistenceResponse.success(ID, DittoHeaders.empty()).toJson();
        assertThat(jsonObject).isEqualTo(KNOWN_JSON);
    }

focal_method.body:
public static CleanupPersistenceResponse success(final EntityId entityId, final DittoHeaders dittoHeaders) {
        return new CleanupPersistenceResponse(entityId, HttpStatusCode.OK, dittoHeaders);
    }
